import React from "react";
import './aboutme.css';
import selfieMinha from './insta.PNG';

function About (){

    return(
        <div  className="me">
          <div className="fotominha" > <img id="ft"src={selfieMinha} /> </div>
          <div className="resumo" > <h1>Olá, me chamo Carlos Henrique Pizzi, nasci em uma cidade no interior de São Paulo, 
            atualmente tenho 22 anos. Fui militar durante quatro anos na Academia da Força Aérea (AFA), 
            durante esse tempo trabalhei em um setor administrativo onde me interessei pela área de programação, atualmente estudo e possuo conhecimentos em HTML / CSS / JS / REACT / NODEJS.
            Meu objetivo no momento é encontrar uma vaga na área e me dedicar para absorver o máximo de experiencia e conhecimentos em situações reais de trabalho.
             </h1> 
             <div className="button" >
             <button id="button">LER MAIS</button>
             </div>


             </div>

        </div>
    )
}

export default About
